import { Component, Injectable, forwardRef, Inject } from '@angular/core';
import { Pipe, PipeTransform } from '@angular/core';
import { Configuration } from '../config';
import { HttpClient } from '../service/HttpClient';
import { Observable } from 'rxjs/Observable';
import { Subscriber } from 'rxjs/Subscriber';
import { Subject } from 'rxjs/Subject';

import 'rxjs/add/operator/map';
import 'rxjs/add/operator/switchMap';

@Pipe({name: 'imgsec'})
export class ImagePipe implements PipeTransform {

  noImageData : string = 'data:image/jpeg;base64,';
  noImage : string = Configuration.get().resourceFile + "/image/show/noimage.jpg";

  constructor(private http: HttpClient) {}

  transform(url: string) {
        if (url === null || url === undefined ){
          url = Configuration.get().resourceFile + "/image/show/noimage.jpg";
        }  

        if ( !(url.toLowerCase().endsWith('png')   || url.toLowerCase().endsWith('jpg') 
             || url.toLowerCase().endsWith('jpeg') || url.toLowerCase().endsWith('gif')
             || url.toLowerCase().endsWith('bmp')  || url.toLowerCase().endsWith('tif')
             || url.toLowerCase().endsWith('tiff')) 
          ){
          url = Configuration.get().resourceFile + "/image/show/noimage.jpg";
        }

        //let ob = new Observable<string>();
        let subject = new Subject<string|ArrayBuffer>()

        this.http.getImage(url).subscribe(res => {
            let reader = new FileReader();
            reader.onloadend = () => {
                subject.next(reader.result);
                subject.complete();
            };
            reader.readAsDataURL(res); 
        },
        error => {
          subject.next(this.noImageData);
          subject.complete();
        }); 
        return subject.asObservable();
  }

}